import { BrowserRouter, Routes, Route } from "react-router-dom"
import Registration from "./components/Registration"

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
         <Route path="/" element={<Registration/>}/>
         <Route path="*" element={<h1>Not found</h1>}/>
      </Routes>
    </BrowserRouter>
  )
}

export default App
